import { TodoTitulo } from './TodoTitulo';
import { TodoBusqueda } from './TodoBusqueda';
import {TodoList} from './TodoList';
import { TodoItem } from './TodoItem';
import { CreateBoton } from './Boton';
import './CSS/Global.css'
import React from 'react';

function App() {

  const defaultTodos = [
    {text: 'Cortar Cebolla', completed: true},
    {text:'Tomar Curso de React', completed:false},
    {text:'Llorar con la llorona', completed:false},
    {text:'Tener un gato', completed: false},];

  return (
   <React.Fragment>{/*<div className="App">*/}

      <TodoTitulo Contador={3} total={5}></TodoTitulo>
      <TodoBusqueda></TodoBusqueda>
      <TodoList >
      {defaultTodos.map(todo => (<TodoItem key = {todo.text} text = {todo.text} completed = {todo.completed}></TodoItem>))}
      </TodoList >
     <CreateBoton/> 
     {/* Haci se crean los comentarios en JSX */}

     </React.Fragment>  
  );
}





export default App;
